import React from "react";

function Footer() {
    let copy = ReasonReact.stringToElement({u00a9});
    return (
        <footer className="footer">
            <div className="footer-content">
                <p> Copyright {copy} </p>
                <span className="footer-icons">
                    <a href="mailto:npatel224@gmail.com" target="_blank">
                        <img className="footer-icon" src="../public/images/email-icon-white-png-original.png" alt="email-icon" />
                    </a>
                    <a href="https://github.com/Nils224" target="_blank">
                        <img className="footer-icon" src="../public/images/GitHub-Mark-Light-32px.png" alt="GitHub-icon" />
                    </a>
                    <a href="https://www.linkedin.com/in/nilesh-patel-6b093783/#"  target="_blank">
                        <img className="footer-icon" src="../public/images/linkedin-6-32.png" alt="LinkedIn-icon" />
                    </a>
                </span>
            </div>
        </footer>
    );
}

export default Footer;
